test "idFromState" {
    try std.testing.expect(idFromState(.{ .air = {} }) == 0);
    try std.testing.expect(idFromState(.{ .redstone_wire = .{
        .east = .up,
        .north = .up,
        .power = 0,
        .south = .up,
        .west = .up,
    } }) == 2114);
    try std.testing.expect(idFromState(.{ .redstone_wire = .{} }) == 3274);
}
